import React from 'react'

const Register = ({userData, handleValue, registerUser}) => {
  return (
    <div className=" flex flex-col items-center h-screen justify-center">
    <h1>livegab</h1>
    <input
      name="username"
      className=" w-[30%] h-[5%] border rounded border-slate-600 text-center mb-4"
      placeholder="Enter your user name"
      value={userData.username}
      onChange={handleValue}
    />
    <button type="button" onClick={registerUser} className="w-[30%] h-[5%] bg-green-800 text-white rounded hover:bg-green-600">
      Join
    </button>
  </div>
  )
}

export default Register
